import './Nuestras.css';
import REturnIMA from './IMA';
import REturnQuOte from './Quote';
import Media from 'react-media';

// REturn view component 
export default function REturnNuestras() {
 return (
  <div className='flex-center-nuestras'>
   <h1>Nuestras functionalidades</h1>

   <Media
    queries={{
     small: '(max-width: 599px)',
     medium: '(min-width: 600px) and (max-width:1199px)',
     large: '(min-width: 1200px)',
    }}>
    {matches => (
     <>
      {matches.small && <ScreenSmall />}
      {matches.medium && <ScreenLarge />}
      {matches.large && <ScreenLarge />}
     </>
    )}
   </Media>
  </div>
 )
};

export const ScreenLarge = () => (
 <div className='flex-nuestras-sub'>
  <REturnIMA />
  <REturnQuOte />
 </div>
);
export const ScreenSmall = () => (
 <div className='flex-nuestras-sub-sm'>
  <REturnIMA />
  <REturnQuOte />
 </div>
);
